INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, "リリ", 1, 125801, 1, 1, 321);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, "クリア", 1, 126001, 1, 2, 322);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, 24001, "んーと。\nこれ、あげる。\nはい", 40011, "プレシア", 1, 126101, 1, 3, 323);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, "リリ", 2, 125801, 1, 4, 324);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, "クリア", 2, 126001, 1, 5, 325);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, 24001, "お兄。\nきてくれて、うれしい", 40011, "プレシア", 2, 126101, 1, 6, 326);
